def slat(lat, precision=0):

    if abs(lat) <= 1.e-2:
        return 'Eq.'

    if abs(lat - 90) <= 1.e-2:
        return 'N.P.'

    if abs(lat + 90) <= 1.e-2:
        return 'S.P.'

    return f'{abs(lat):.{precision}f}{"N" if lat > 0 else "S"}'

