def angular_velocity(x1, x2, t, sample_size, deviations=True):


    if deviations:
        x1 = x1 - x1.mean()
        x2 = x2 - x2.mean()

    angvec = x1[:sample_size] * x2[t:sample_size + t] - x1[t:sample_size + t] * x2[:sample_size]
    return angvec.mean(), angvec.std()

