    x[..., 2] *= 0.225
    x[..., 0] += 0.485
    x[..., 1] += 0.456
    x[..., 2] += 0.406
    x *= 255.
    if return_int:
        return x.clip(0, 255).astype('uint8')
    else:
        return x.clip(0, 255)

