            / num_data
        )
    )

def flattened_to_standard(positions):

    n_atoms = positions.shape[-1] // 3
    if len(positions.shape) > 1:
        batch_size = positions.shape[0]
        standard_shape = (batch_size, n_atoms, 3)
    else:
