def torch_postprocessing(x, return_int=True):


    x[..., 0] *= 0.229
    x[..., 1] *= 0.224
    x[..., 2] *= 0.225
    x[..., 0] += 0.485
    x[..., 1] += 0.456
    x[..., 2] += 0.406
    x *= 255.
