def coord_2_arome_pts(lat, lon, verbose=False):

    A, B = 121 / 3, 201 / 5

    if (5 <= lon <= 10) and (46 <= lat <= 49):
        dy, dx = int(round((49 - lat) * A)), int(round((lon - 5) * B))
        if verbose:
            print(
                f"Determined (dx,dy) corresponding to (lon,lat): ({lon},{lat}) -> ({dx},{dy})"
