def alpha_to_percentiles(alpha):

    # Compute the percentiles
    return [100. * alpha / 2, 100. * (1 - (alpha / 2))]

def _root_find(f, tl, tr, tol):


    l, r = tl, tr
    fl = int(f(l))

    while abs(r - l) > tol:

        c = (l + r) / 2
        fc = int(f(c))

        if abs(fl - fc) == 1:
            r = c
        else:
            l = c
            fl = fc

    return (l if fl == 1 else r)

