def as_tuple(x, N):

    try:
        X = tuple(x)
    except TypeError:
        X = (x,) * N

    if len(X) != N:
        raise ValueError("input must be a single value "
                         "or an iterable with length {0}".format(N))

    return X

def reduce_array_shape(shape):

    shape = list(shape)

    while shape and shape[-1] == 1:
        shape.pop()

    return shape
